import React from "react";

class Footer extends React.Component{
    renderfooter=()=>{
        return(
            <div>
                <div>
                    <h4 className="d-inline mr-auto">Subscribe for email and get 12% off</h4>
                    <form className="form-inline my-2 my-lg-0 d-inline">
                        <input type="text" className="form-control rounded-left" placeholder="Your Email" />
                        <button className="btn btn-outline-success my-2 my-sm-0">SubScribe</button>
                   </form>
                </div>
            </div>
        )
    }
    render(){
        return(
            <div className="bg-dark p-5 my-5">
                {this.renderfooter()}
            </div>
        )
    }
}
export default Footer
